import React, { useState } from 'react';
import './Community.css';

function Community({ user, onUpdateUser }) {
    const [posts, setPosts] = useState([
        { id: 1, user: "User123", content: "Meditation has been helping me so much with my anxiety lately! üßò‚Äç‚ôÄÔ∏è", likes: 15, comments: 3, time: "2 hours ago" },
        { id: 2, user: "WellnessWarrior", content: "Just completed my 30-day mindfulness challenge! Feeling proud! üí™", likes: 28, comments: 7, time: "5 hours ago" },
        { id: 3, user: "CalmSoul", content: "Any recommendations for good sleep meditation apps? Having trouble sleeping üò¥", likes: 12, comments: 9, time: "1 day ago" }
    ]);
    
    const [newPost, setNewPost] = useState('');

    const createPost = () => {
        if (newPost.trim()) {
            const post = {
                id: posts.length + 1,
                user: user.username,
                content: newPost,
                likes: 0,
                comments: 0,
                time: "Just now",
                reactions: {}
            };
            setPosts([post, ...posts]);
            setNewPost('');
            // Add coins for community engagement
            onUpdateUser({ coins: (user.coins || 0) + 2 });
        }
    };

    const addReaction = (postId, reaction) => {
        setPosts(posts.map(post => {
            if (post.id === postId) {
                const newReactions = { ...post.reactions };
                newReactions[reaction] = (newReactions[reaction] || 0) + 1;
                return { ...post, reactions: newReactions };
            }
            return post;
        }));
    };

    return (
        <div className="community-container">
            <div className="community-header">
                <h2>üåç Community Support</h2>
                <p>Share your journey and support others</p>
            </div>

            <div className="create-post">
                <textarea
                    value={newPost}
                    onChange={(e) => setNewPost(e.target.value)}
                    placeholder="Share your thoughts or experiences..."
                    rows="3"
                />
                <button onClick={createPost} className="post-btn">
                    Post
                </button>
            </div>

            <div className="posts-container">
                {posts.map(post => (
                    <div key={post.id} className="post-card">
                        <div className="post-header">
                            <div className="post-user">
                                <div className="user-avatar-small">
                                    {post.user.charAt(0).toUpperCase()}
                                </div>
                                <span>{post.user}</span>
                            </div>
                            <span className="post-time">{post.time}</span>
                        </div>
                        
                        <div className="post-content">
                            {post.content}
                        </div>

                        <div className="post-actions">
                            <div className="reactions">
                                {['‚ù§Ô∏è', 'üëç', 'üéâ', 'ü§ó', 'üôè'].map(reaction => (
                                    <button
                                        key={reaction}
                                        className="reaction-btn"
                                        onClick={() => addReaction(post.id, reaction)}
                                    >
                                        {reaction}
                                    </button>
                                ))}
                            </div>
                            
                            {post.reactions && Object.keys(post.reactions).length > 0 && (
                                <div className="reaction-counts">
                                    {Object.entries(post.reactions).map(([reaction, count]) => (
                                        <span key={reaction} className="reaction-count">
                                            {reaction} {count}
                                        </span>
                                    ))}
                                </div>
                            )}

                            <div className="action-buttons">
                                <button className="action-btn">
                                    ‚ù§Ô∏è Like ({post.likes})
                                </button>
                                <button className="action-btn">
                                    üí¨ Comment ({post.comments})
                                </button>
                                <button className="action-btn">
                                    üîó Share
                                </button>
                            </div>
                        </div>
                    </div>
                ))}
            </div>
        </div>
    );
}

export default Community;
